import './loggedout.cc'
const LoggedOut = () => {
    // headers will ne today, trending, spotlight
    return (
        <div className='tabs'>
            <ul className='tab-selection'>
                <li>Today</li>
                <li>Trending</li>
                <li>Spotlight</li>
                <li>More with arrow</li>
            </ul>
        </div>
    )
}

export default LoggedOut;
